script: |
  super -f text -I q11633.spq | sort > q11633.out

inputs:
  - name: q11633.spq
    data: |
      SELECT col0 / - + ( ( + col2 ) ) + col2 + - col2 + 26 + + 35 * - col2 / col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q11633.out
    data: |
      -10
      -10
      -9
